import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Navbar from "react-bootstrap/Navbar";

const Bottom = () => {
  return (
    <div>
      <Navbar sticky="bottom" style="center">
        I immensely enjoyed this bootcamp with all of you! Cheers, your fellow
        GitHub-er @TracyVy
      </Navbar>
    </div>
  );
};

export default Bottom;
